import React from 'react';
import './App.css';
import ConferenceItem from './conferenceItem';

function App() {

  const book1 = { id: 1, name: "Book 1", img: require('./images/book1.jpg') };
  const book2 = { id: 2, name: "Book 2", img: require('./images/book1.jpg') };
  const book3 = { id: 3, name: "Book 3", img: require('./images/book1.jpg') };
  const book4 = { id: 4, name: "Book 4", img: require('./images/book1.jpg') };

  return (
    <div className="App">
      <ConferenceItem book={book1} />
      {/* <ConferenceItem book={book2} />
      <ConferenceItem book={book3} />
      <ConferenceItem book={book4} /> */}
    </div>
  );
}

export default App;
